import './App.css';
import React, { useState, useEffect } from 'react';



function App() {

  const [categories, setCategories] = useState([])

  const [gameStarted, setGameStarted] = useState(false)

  const [questionNumber, setQuestionNumber] = useState("")
  const [difficulty, setDifficulty] = useState("")
  const [questionType, setQuestionType] = useState("")


  async function fetchData(){
    try{
      const response = await fetch('https://opentdb.com/api_category.php')
      const data = await response.json()
      const dataArray = data.trivia_categories
      setCategories(dataArray)
    }
    catch(error){
      console.error('Error fetching data:', error);
    }
  }

  function handleGameStarted(){
    setGameStarted(prevData => !prevData)
  }
  function holdButton(){

  }


  const subjectCatalogue =categories.map(category => (

      <button value={category.id} onClick={(e) => console.log(e.target.value)}>{category.name}</button>
  )
  ) 


  useEffect(() =>{ 
    fetchData()
  },[])

  return (
    <div className="App">
      {
      gameStarted ? 
      <div>Game Started!</div>
      :
      <main>
      <div className='header-container'>
        <h1 className='header'>Quizzical</h1>
        <p className='subheader'>Let's get quizzical!</p>
        <button onClick={()=>console.log(categories)}>Hey</button>
      </div>

      <div className='container-container'>
        <div className='category-container'>
          <h3>Category</h3>
          <div className='container-buttons'>
              <button>Any category</button>
              {subjectCatalogue}
          </div>
        </div>

        <div className='questions-number-container'>
          <h3>Number of Questions</h3>
          <div className='container-buttons'>
          {['10', '20', '30', '40', '50'].map((num) => (
                  <button
                    key={num}
                    value={num}
                    className={questionNumber === num ? 'selected' : 'btn-choice'}
                    onClick={() => setQuestionNumber(num)}
                  >
                    {num}
                  </button>
             )) }
          </div>

        </div>

        <div className='difficulty-container'>
          <h3>Difficulty</h3>
          <div className='container-buttons'>
            <button value="">Any difficulty</button>
            <button value="easy">Easy</button>
            <button value="medium">Medium</button>
            <button value="hard">Hard</button>
          </div>

        </div>

        <div className='question-type-container'>
          <h3>Type of Question</h3>
          <div className='container-buttons'>
            {["", "multple", "boolean"].map((val)=> (
              <button value={val}
              key={val}
              className= {questionType === val ? 'selected' : 'btn-choice'}
              onClick={setQuestionType(val)}>
                {val}
                </button>
            ))

          }
          </div>

        </div>


      </div>
      <div className='button-container'>
          <button type='submit' onClick={handleGameStarted}>Start Game</button>
      </div>
      </main>
}
    </div>
  );
}

export default App;
